script: |
  super -f text -I q3664.spq | sort > q3664.out

inputs:
  - name: q3664.spq
    data: |
      SELECT 61 - col0 + + CAST ( + col1 AS INTEGER ) * + col1 * 46 + - 7 + + + col1 AS col1 FROM tab2 (FORMAT parquet) cor0 WHERE NULL BETWEEN NULL AND 30 * + col2 * - 90;
  - name: tab2

outputs:
  - name: q3664.out
    data: |
